2803887722080936828=<ph name="BEGIN_H3">డీబగ్గింగ్ లక్షణాలు<ph name="END_H3"><br>    <ph name="BR"><br>    మీరు మీ పరికరంలో అనుకూల కోడ్‌ను ఇన్‌స్టాల్ చేసి, పరీక్షించడానికి మీ Chrome OSలో డీబగ్గింగ్ లక్షణాలను ప్రారంభించవచ్చు.  ఇది వీటిని చేయడానికి మిమ్మల్ని అనుమతిస్తుంది:<ph name="BR"><br>    <ph name="BEGIN_LIST"><br>      <ph name="LIST_ITEM">rootfs ధృవీకరణను తీసివేయడానికి, దీని వలన మీరు OS ఫైల్‌లను సవరించవచ్చు<br>      <ph name="LIST_ITEM">ప్రామాణిక పరీక్ష కీలను ఉపయోగించే పరికరానికి SSH ప్రాప్యతను ప్రారంభించడానికి, దీని వలన మీరు పరికరాన్ని ప్రాప్యత చేయడానికి <ph name="BEGIN_CODE">'క్రాస్ ఫ్లాష్'<ph name="END_CODE"> వంటి సాధనాలను ఉపయోగించవచ్చు<br>      <ph name="LIST_ITEM">USB నుండి బూటింగ్‌ను ప్రారంభించడానికి, దీని వలన మీరు USB డ్రైవ్ నుండి OS ఇమేజ్ ఇన్‌స్టాల్ చేయవచ్చు<br>      <ph name="LIST_ITEM">డెవలపర్ మరియు సిస్టమ్ రూట్ లాగిన్ పాస్‌వర్డ్ రెండింటినీ అనుకూల విలువకి సెట్ చేయడానికి, దీని వలన మీరు పరికరంలోకి మాన్యువల్‌గా SSH చేయవచ్చు<br>    <ph name="END_LIST"><br>    <ph name="BR"><br>    ప్రారంభించిన తర్వాత, డీబగ్గింగ్ లక్షణాల్లో చాలా వరకు వ్యాపార సంస్థ నిర్వహిత పరికరంలో డేటాను పవర్‌వాష్ చేసిన తర్వాత లేదా తొలగించిన తర్వాత కూడా అలాగే ప్రారంభించబడి ఉంటాయి. అన్ని డీబగ్గింగ్ లక్షణాలను పూర్తిగా నిలిపివేయడానికి, Chrome OS పునరుద్ధరణ ప్రాసెస్‌ను (https://support.google.com/chromebook/answer/1080595) పూర్తి చేయండి.<br>    <ph name="BR"><br>    <ph name="BR"><br>    డీబగ్గింగ్ లక్షణాల గురించి మరింత సమాచారం కోసం ఇక్కడ చూడండి:<ph name="BR"><br>    http://www.chromium.org/chromium-os/how-tos-and-troubleshooting/debugging-features<br>    <ph name="BR"><br>    <ph name="BR"><br>    <ph name="BEGIN_BOLD">గమనిక:<ph name="END_BOLD">  ప్రాసెస్ జరుగుతున్నప్పుడు సిస్టమ్ రీబూట్ అవుతుంది.</ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph>
